import React from "react";


const Button = (props) => {
    var theClass = "button";
    if (props.buttonType == "card") {
        theClass = "card-button";
    } else if (props.buttonType == "nav") {
        theClass = "nav-button";
    }
    return (

        <button className={theClass}> {props.buttonName}
        </button >

    )
}

export default Button;
